import React from 'react'; // Import the Component component from React
import {Link} from 'react-router-dom'; // Import the Link component
import '../css/App.css';
import HomepageProject from './homepageProject.js'

const project_total = "03"

function Home(props) {
  return (
    <div>
      <HomepageProject
       projectKey={'panaseer'}
       number="01"
       total={project_total}
       colour="#0FFFB0"
      />
      <HomepageProject
       projectKey={'joyStory'}
       number="02"
       total={project_total}
       colour="#FF491C"
      />
      <HomepageProject
       projectKey={'spiro'}
       number="03"
       total={project_total}
       colour="#FFEE1C"
      />
    </div>
  );
}

export default Home;
